import React from "react";

function Header() {
  return (
    <div>
      <div className="container-fluid  header">
        <img
          src="./pics/pic1.jpg"
          className="img-fluid img-responsive opacity-50"
          alt=""
        />
      </div>
    </div>
  );
}

export default Header;
